contracts/RawAlkes.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

import './Transactions.sol';

contract RawAlkes {
    address public Owner;

    enum PackageStatus { AtManufacturer, AtDistributor, AtKemenkes, AtRumahSakit }

    struct AlkesDetails {
        bytes32 namaAlkes;
        bytes32 deskripsiAlkes;
        bytes32 klasifikasiAlkes;
        bytes32 tipeAlkes;
        bytes32 kelasAlkes;
        bytes32 kelasResiko;
        bytes32 noIzinEdar;
    }

    address public productid;
    address public distributor;
    address public manufakturer;
    address public kemenkes;
    address public rumahSakit;

    AlkesDetails public alkesDetails;
    PackageStatus public status;
    address public txnContractAddress;

    constructor(
        address _creatorAddr,
        address _productid,
        AlkesDetails memory _alkesDetails,
        address _distributorAddr,
        address _kemenkesAddr,
        address _rumahSakitAddr
    ) {
        Owner = _creatorAddr;
        productid = _productid;
        alkesDetails = _alkesDetails;
        manufakturer = _creatorAddr;
        distributor = _distributorAddr;
        kemenkes = _kemenkesAddr;
        rumahSakit = _rumahSakitAddr;
        status = PackageStatus.AtManufacturer;
        initializeTxnContract(_distributorAddr);
    }

    function initializeTxnContract(address _distributorAddr) internal {
        Transactions txnContract = new Transactions(_distributorAddr);
        txnContractAddress = address(txnContract);
    }

    function getRawAlkes()
        public
        view
        returns (
            address,
            AlkesDetails memory,
            address,
            address,
            address,
            address,
            address
        )
    {
        return (
            productid,
            alkesDetails,
            manufakturer,
            distributor,
            kemenkes,
            rumahSakit,
            txnContractAddress
        );
    }

    function getNamaAlkes() public view returns (bytes32) {
        return alkesDetails.namaAlkes;
    }

    function getKlasifikasiALkes() public view returns (bytes32) {
        return alkesDetails.klasifikasiAlkes;
    }

    function getRawAlkesStatus() public view returns (uint) {
        return uint(status);
    }

    function updatedistributorAddress(address addr) public {
        distributor = addr;
        status = PackageStatus.AtDistributor;
    }

    function distributorToKemenkes(address addr) public {
        kemenkes = addr;
    }

    function izinEdarApprove(bytes32 nomor, address addr) public {
        alkesDetails.noIzinEdar = nomor;
        kemenkes = addr;
        status = PackageStatus.AtKemenkes;
    }

    function distributorToRs(address addr) public {
        rumahSakit = addr;
        status = PackageStatus.AtRumahSakit;

    }
}

contracts/Transactions.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

contract Transactions {

    address public Creator;

    struct Txns {
        bytes32 txnHash;
        address fromAddr;
        address toAddr;
        bytes32 prevTxn;
      
        uint timestamp;
    }

    mapping(uint => Txns) public transactions;
    uint public txnCount = 0;

    event TxnCreated(bytes32 _txnHash, address _from, address _to, bytes32 _prev, uint _timestamp);

    constructor(address _creator) {
        Creator = _creator;
    }

    function createTxnEntry(
        bytes32 _txnHash,
        address _from,
        address _to,
        bytes32 _prev
    ) public {
        uint _timestamp = block.timestamp;
        if (txnCount == 0) {
            transactions[txnCount] = Txns(_txnHash, _from, _to, _prev, _timestamp);
        } else {
            require(transactions[txnCount - 1].txnHash == _prev, "Transaction error occurred!");
            transactions[txnCount] = Txns(_txnHash, _from, _to, _prev, _timestamp);
        }
        txnCount += 1;
        emit TxnCreated(_txnHash, _from, _to, _prev, _timestamp);
    }

    function getAllTransactions() public view returns (Txns[] memory) {
        uint len = txnCount;
        Txns[] memory ret = new Txns[](len);
        for (uint i = 0; i < len; i++) {
            ret[i] = transactions[i];
        }
        return ret;
    }
}

